import React from 'react';
import PropTypes from 'prop-types';

import './Table.scss';

Table.propTypes = {
    listIssues: PropTypes.array.isRequired,
    loading: PropTypes.bool.isRequired
}

function Table({listIssues, loading}) {
  return (
    <div className="Table">
        Tableasd {loading}
    </div>
  );
}

export default Table;
